import logo from './logo.svg';
import './App.css';
import { Slider } from './launchPage';
import { Container, Row, Col } from 'react-bootstrap';
function App() {
  return (
    <div className="App">
      <Container>
       <Row>
        <Col xs={6}>sm=8</Col>
        <Col xs={6}>sm=4</Col>
      </Row>
    </Container>
      <Slider />
    </div>
  );
}

export default App;
